function App() {
  return (
    <div className="App">
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/">Abou</Link></li>
        </ul>
      </nav>
      <Routes>
          <Route path="/" element={<Home />}/>
          <Route path="/about" element={<About />} />
          <Route path="/newpost" element={<NewPost />} />
      </Routes>
